import React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';

// telas para a pilha de navegacao
import PrepareToLogin from './pages/PrepareToLogin';
import Home from './pages/Home';
import LinkExpo from './pages/LinkExpo'

const AppStack = createStackNavigator();

const Routes = () => {
  return (
    <NavigationContainer>
      <AppStack.Navigator headerMode="none">
        <AppStack.Screen name="home" component={Home} />
        <AppStack.Screen name="preparetologin" component={PrepareToLogin} />
        <AppStack.Screen name="linkexpo" component={LinkExpo} />
      </AppStack.Navigator>
    </NavigationContainer>
  );
}

export default Routes;
